import React from "react";
import styled from "styled-components";

//Images
import Reward from "../../assets/rewards.png";
import Offer from "../../assets/offers.png";

export default function Last() {
  return (
    <>
      <div>
        <Offers>
          <H3>Offers & rewards</H3>
          <AllPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Reward} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Reward} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Reward} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgContDown>
                <PeopleImgDown src={Offer} alt="OFFER" />
              </PeopleImgContDown>
              <PeopleP>More</PeopleP>
            </EachPeople>
          </AllPeople>
        </Offers>
      </div>
    </>
  );
}

const H3 = styled.h3`
  font-size: 20px;
  font-weight: normal;
  margin-bottom: 20px;
`;
const Offers = styled.div`
  margin: 30px 20px;
`;

// const MiddleSecond = styled.div`
//   margin: 30px 20px;
// `;
const AllPeople = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: wrap;
`;
const EachPeople = styled.div`
  width: 25%;
  margin-bottom: 10px;
`;
const PeopleImgCont = styled.div`
  width: 50px;
  display: block;
  margin: 0 auto;
`;
const PeopleImgContDown = styled.div`
  width: 50px;
  display: block;
  margin: 0 auto;
`;
const PeopleImg = styled.img`
  width: 100%;
  display: block;
  border-radius: 50%;
  margin: 0 auto 6px;
`;
const PeopleImgDown = styled.img`
  width: 100%;
  display: block;
  border-radius: 50%;
  margin: 0 auto 6px;
  border: 1px solid gray;
`;
const PeopleP = styled.p`
  font-size: 12px;
  text-align: center;
`;
